import "./PlaceView.css";
import ReviewList from "../ReviewList/ReviewList";
import { Row, Col } from "antd";
import { Button } from 'antd';
import { PlusOutlined } from '@ant-design/icons';

function PlaceView() {
    let size = 'medium';
  return (
    <div>
      <Row>
        <Col span={24}>
        <Button type="primary" shape="circle" icon={<PlusOutlined style={{ fontSize: '18px', color: 'black', strokeWidth: '100', stroke: "black"}} />} size={size} />
        </Col>
      </Row>
      <ReviewList />
    </div>
  );
}

export default PlaceView;
